// time limit exceeded, probably due to nested for loops
std::vector<int> productExceptSelf(const std::vector<int> &nums)
{
    std::vector<int> solution(nums.size(), 0);
    
    for (int i = 0; i != nums.size(); ++i) {
        int max_product = 1;
        for (int j = 0; j != nums.size(); ++j)
            if (i != j)
                max_product *= nums[j];
        solution[i] = max_product;
    }
    return solution;
}

// better solution
// looks similar to max subarray, with the "i - 1" comparison concept
std::vector<int> productExceptSelf2(const std::vector<int> &nums)
{
    // create temporary solution container
    std::vector<int> solution(nums.size(), 1);
    
    // traverse left-to-right through nums
    // solution[0] = 1
    // solution[1] = 1  (1 * 1)
    // solution[2] = 2  (1 * 2)
    // solution[3] = 6  (2 * 3)
    
    for (int i = 1; i != nums.size(); ++i)
        solution[i] = solution[i - 1] * nums[i-1];
    
    // now traverse right-to-left with the same pattern
    // solution[3] = 6 -> 6  (6 * 1);  rhs = 4  (1  * 4)
    // solution[2] = 2 -> 8  (2 * 4);  rhs = 12 (4  * 3)
    // solution[1] = 1 -> 12 (1 * 12); rhs = 24 (12 * 2)
    // solution[0] = 1 -> 24 (1 * 24); rhs = 24 (24 * 1)
    
    int right_to_left_multiplier = 1;
    for (int i = nums.size() - 1; i != -1; --i) {
        solution[i] *= right_to_left_multiplier;
        right_to_left_multiplier *= nums[i];
    }
        
    return solution;
}

void printSolution(const std::vector<int> &solution)
{
    for (const auto &e : solution) {
        std::cout << e << " ";
    } std::cout << std::endl;
}

